// Meio.jsx
import React from "react";

function Meio({ dados }) {
  return (
    <div className="meio">
      {dados && (
        <div>
          <pre>{JSON.stringify(dados, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default Meio;
